void wordle_insert_letter(const char* letter, int row) {
    for (int i = row * 5; i < row * 5 + 5; i++) {
        if (wordle_display_letter[i][0] == ' ') {
            wordle_display_letter[i] = letter;
            break;
        }
    }
}

void wordle_backspace(int row) {
    for (int i = row * 5 + 4; i >= row * 5; i--) {
        if (wordle_display_letter[i][0] != ' ') {
            wordle_display_letter[i] = " ";
            break;
        }
    }
}

void TextCentered(std::string text) {
    auto windowWidth = ImGui::GetWindowSize().x;
    auto textWidth   = ImGui::CalcTextSize(text.c_str()).x;

    ImGui::SetCursorPosX((windowWidth - textWidth) * 0.5f);
    ImGui::Text(text.c_str());
}

bool ButtonCenteredOnLine(const char* label, float alignment = 0.5f)
{
    ImGuiStyle& style = ImGui::GetStyle();

    float size = ImGui::CalcTextSize(label).x + style.FramePadding.x * 2.0f;
    float avail = ImGui::GetContentRegionAvail().x;

    float off = (avail - size) * alignment;
    if (off > 0.0f)
        ImGui::SetCursorPosX(ImGui::GetCursorPosX() + off);

    return ImGui::Button(label);
}

const char* wordle_getword_in_row(int rowIndex) {
    const int rowSize = 5;
    const int bufferSize = rowSize * 2 + 1;
    char buffer[bufferSize];
    memset(buffer, 0, bufferSize);

    for (int i = 0; i < rowSize; i++) {
        const char* letter = wordle_display_letter[rowIndex * rowSize + i];
        if (letter[0] != ' ') {
            strcat(buffer, letter);
        }
    }
    return _strdup(buffer);
}

