bool wordle_search_lib(const char* word, const char* words[], int size) {
    std::unordered_set<std::string> word_set;
    for (int i = 0; i < size; i++) {
        std::string lowercase_word = words[i];
        std::transform(lowercase_word.begin(), lowercase_word.end(), lowercase_word.begin(), ::tolower);
        word_set.insert(lowercase_word);
    }
    std::string lowercase_search_word = word;
    std::transform(lowercase_search_word.begin(), lowercase_search_word.end(), lowercase_search_word.begin(), ::tolower);
    return word_set.find(lowercase_search_word) != word_set.end();
}

