void wordle_validate_row(int row, const char* target_word, const char* guess)
{
    const int MAX_LENGTH = 5; // maximum length of the words
    int feedback[MAX_LENGTH] = {0}; // initialize the feedback array to zero
    bool matched[MAX_LENGTH] = {false}; // initialize the matched array to false

    // convert the guess to lowercase
    char lowercase_guess[MAX_LENGTH+1];
    std::strcpy(lowercase_guess, guess);
    for (int i = 0; i < MAX_LENGTH; i++)
    {
        lowercase_guess[i] = std::tolower(lowercase_guess[i]);
    }

    // compare the guess to the target word and update the feedback array
    for (int i = 0; i < MAX_LENGTH; i++)
    {
        if (lowercase_guess[i] == target_word[i])
        {
            feedback[i] = 3; // correct letter and position
            matched[i] = true;
        }
    }

    for (int i = 0; i < MAX_LENGTH; i++)
    {
        if (!matched[i])
        {
            for (int j = 0; j < MAX_LENGTH; j++)
            {
                if (!matched[j] && i != j && lowercase_guess[i] == target_word[j])
                {
                    feedback[i] = 2; // letter exists but in the wrong position
                    matched[j] = true;
                    break;
                }
                else if (j == MAX_LENGTH - 1)
                {
                    feedback[i] = 1; // mismatch
                }
            }
        }
    }

    // construct the feedback string based on the feedback array
    char* feedback_str = new char[MAX_LENGTH+1];
    for (int i = 0; i < MAX_LENGTH; i++)
    {
        switch (feedback[i])
        {
            case 1:
                feedback_str[i] = '1';
                break;
            case 2:
                feedback_str[i] = '2';
                break;
            case 3:
                feedback_str[i] = '3';
                break;
            default:
                feedback_str[i] = '1';
                break;
        }
    }
    feedback_str[MAX_LENGTH] = '\0';

    std::thread wordle_anim_thr(wordle_animate_row, row, false, feedback_str, true);
    wordle_anim_thr.detach();
}

void wordle_clear()
{
    for (int i = 0; i < 6; i++)
    {
        std::thread wordle_anim_thr(wordle_animate_row, i, true, "00000", false);
        wordle_anim_thr.detach();
        std::this_thread::sleep_for(std::chrono::milliseconds(120));
    }
}

void wordle_handle_enter()
{
    wordle_allow_enter = false;
    if (strlen(wordle_getword_in_row(curr_row_index)) == 5) //check if 5 characters long
    {
        if  (wordle_search_lib(wordle_getword_in_row(curr_row_index), word_library, IM_ARRAYSIZE(word_library))) //check if word exists in library
        {
            if (strlen(wordle_word) < 5)
            {
                wordle_newword();
            }
            
            wordle_validate_row(curr_row_index, wordle_word, wordle_getword_in_row(curr_row_index));
        }
        else
        {
            std::thread wordle_shake_thr(wordle_shake_row,curr_row_index);
            wordle_shake_thr.detach();
        }

    }
    else
    {
        std::thread wordle_shake_thr(wordle_shake_row,curr_row_index);
        wordle_shake_thr.detach();
    }

}

void wordle_newgame()
{
    wordle_game_end_state = 0;
    std::thread wordle_clear_thr(wordle_clear);
    wordle_clear_thr.detach();
    curr_row_index = 0;
    wordle_word = " ";
    is_during_game = true;
    wordle_keyinput_enabled = true;
}


